import React, { useState } from "react";
import { Grid } from "@material-ui/core";
import Content from "./Content";

function OurWorks() {
  const [featured] = useState([
    {
      title: "KEMIS YELEBESKU LET",
      image: "assets/kemis-yelebesku.png",
      type: "Feature Film",
      description:"Video production work with"
    },
    {
      title: "TEDDY AFRO - MAR ESKE TUAF",
      image: "assets/teddy-afro.png",
      type: "Music Video",
      description:"Video production work with"
    },
    {
      title: "EWUR AMORA KELABI",
      image: "assets/ewuramora.png",
      type: "Documentary",
      description:"Video production work with"
    },
    {
      title: "JAON BEER",
      image: "assets/jano.png",
      type: "Advertising",
      description:"Video production work with"
    },
  ]);

  return (
    <Grid container direction="column" alignItems="center" spacing={3}>

        {featured.map((f, key) => (
          <Grid key={key} container item item xs={12} sm={12} md={12}>
            <Content {...f} />
          </Grid>

        ))}
      </Grid>
  );
}

export default OurWorks;
